import React, { useState } from 'react';
import axios from 'axios';
import toast from 'react-hot-toast';

const UploadVideo = () => {
  const [formData, setFormData] = useState({
    title: '',
    description: '',
    videoType: 'short'
  });
  const [videoFile, setVideoFile] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      // Check file size based on video type
      const maxSize = formData.videoType === 'short' ? 50 * 1024 * 1024 : 500 * 1024 * 1024;
      
      if (file.size > maxSize) {
        toast.error(`File size exceeds ${formData.videoType === 'short' ? '50MB' : '500MB'} limit`);
        return;
      }
      
      setVideoFile(file);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    if (!videoFile) {
      toast.error('Please select a video file');
      return;
    }

    setLoading(true);

    try {
      const formDataToSend = new FormData();
      formDataToSend.append('video', videoFile);
      formDataToSend.append('title', formData.title);
      formDataToSend.append('description', formData.description);

      const endpoint = formData.videoType === 'short' 
        ? '/api/videos/upload/short' 
        : '/api/videos/upload/long';

      await axios.post(endpoint, formDataToSend, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });

      toast.success('Video uploaded successfully!');
      
      // Reset form
      setFormData({ title: '', description: '', videoType: 'short' });
      setVideoFile(null);
      e.target.reset();
    } catch (error) {
      toast.error(error.response?.data?.message || 'Upload failed');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="container">
      <h1>Upload Video</h1>
      
      <div className="card">
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label>Video Type</label>
            <select
              name="videoType"
              value={formData.videoType}
              onChange={handleChange}
              className="form-control"
            >
              <option value="short">Short Video (â‰¤ 45 seconds)</option>
              <option value="long">Long Video</option>
            </select>
          </div>
          
          <div className="form-group">
            <label>Title</label>
            <input
              type="text"
              name="title"
              value={formData.title}
              onChange={handleChange}
              required
              maxLength="100"
              placeholder="Enter video title"
            />
          </div>
          
          <div className="form-group">
            <label>Description</label>
            <textarea
              name="description"
              value={formData.description}
              onChange={handleChange}
              maxLength="500"
              placeholder="Enter video description (optional)"
              rows="3"
            />
          </div>
          
          <div className="form-group">
            <label>Video File</label>
            <input
              type="file"
              accept="video/*"
              onChange={handleFileChange}
              required
            />
            <small className="form-text text-muted">
              {formData.videoType === 'short' 
                ? 'Max file size: 50MB, Max duration: 45 seconds' 
                : 'Max file size: 500MB'}
            </small>
          </div>
          
          <button type="submit" className="btn btn-primary" disabled={loading}>
            {loading ? 'Uploading...' : 'Upload Video'}
          </button>
        </form>
      </div>
    </div>
  );
};

export default UploadVideo;
